import React from 'react';
import Navigation from '../components/Navigation';
import Tasks from '../components/Tasks';
import TaskForm from '../components/TaskForm';

const TasksPage = () => {
  return (
    <div>
      <h2>TEEESTING</h2>
      <Navigation />
      <Tasks />
      <TaskForm />
    </div>
  );
};

export default TasksPage;
